  $(".inventoryItemContainer").html("");
  $(".bankRightPlayerInventory").html("");
  $(".bankRightToDeposit").html("");
  $(".bankItemContainer").html("");
  // Draw inventory
  drawInventory("inventoryItemContainer", inventory);
