$(".bankRightDepositButton").click(function() {
  $(".depositorContainer").html("");
  if(Object.keys(bankTemp).length !== 0) {
    inventoryCurrent -= Object.keys(bankTemp).length;
    depositItems();
    inventoryReDrawAfterBank();
  }
});

// Item removed from deposit box

$(".bankRightToDeposit").on("click", ".inventoryItem", function() {
  if (inventoryCurrent <= inventoryMax) {
    if (bankTemp[this.id]) {
      var item = eval(atob(bankTemp[this.id]));
      drawPlayerItem("bankRightPlayerInventory", item.name, item.price, item.img, this.id, item.rarity);
      depositSkinsValue -= item.price;
      updateDepositInfo();
      delete bankTemp[this.id];
      $(this).remove();
    }
  }
});

function depositItems() {
  var bankTempKeys = Object.keys(bankTemp);
  for (var skin in bankTemp) {
    if (bankTemp.hasOwnProperty(skin)) {
      if (inventory.hasOwnProperty(skin)) {
        
        bank[skin] = bankTemp[skin];
        bankCurrent += 1;
        
        delete inventory[skin];
		delete bankTemp[skin];
		
      } 
    }
  }
  depositSkinsValue = 0;
  updateDepositInfo();
  drawInventory("bankItemContainer", bank);
  saveGameState();  
}

$(".bankItemContainer").on("click", ".inventoryItem", function() {
  if (inventoryCurrent <= inventoryMax) {
    if (bank[this.id]) {
      var item = eval(atob(bank[this.id]));
      inventory[this.id] = bank[this.id];
      drawPlayerItem("bankRightPlayerInventory", item.name, item.price, item.img, this.id, item.rarity);
	    bankCurrent -= 1;
	    inventoryCurrent += 1;
      delete bank[this.id];
      $(this).remove();
	    updateDepositInfo();
	    inventoryReDrawAfterBank();
	    saveGameState();
    }
  }
});

